  function calculatePercentageForSetting(settingName, defaultValue) {
    let min, max;
    switch (settingName) {
      case "‰∫ÆÂ∫¶":
        min = 20; max = 100; break;
      case "Ëâ≤Áõ∏":
        min = 0; max = 360; break;
      case "ÂØπÊØîÂ∫¶":
        min = 20; max = 100; break;
      case "È•±ÂíåÂ∫¶":
        min = 0; max = 250; break;
      default:
        min = 0; max = 100;
    }
    return ((defaultValue - min) / (max - min)) * 100;
  }

