  function isNightModeApplied() {
    var win = window;
    while (win) {
      try {
        // Â¶ÇÊûúÂΩìÂâçÁ™óÂè£ÂÖ∑Êúâdata-night-modeÂ±ûÊÄßÔºåÂàôËøîÂõûtrue
        if (win.document.documentElement.hasAttribute('data-night-mode')) {
          return true;
        }
        if (win.parent === win) {
          break; // Â¶ÇÊûúÊ≤°ÊúâÁà∂Á™óÂè£ÔºåÂàôË∑≥Âá∫Âæ™ÁéØ
        }
        win = win.parent; // Êü•ÁúãÁà∂Á™óÂè£
      } catch (e) {
        break; // Ë∑®ÂüüËÆøÈóÆÊó∂‰ºöÊäõÂá∫ÂºÇÂ∏∏ÔºåÊ≠§Êó∂Êó†Ê≥ïÊü•ÁúãÁà∂Á™óÂè£ÁöÑÂ±ûÊÄß
      }
    }
    return false; // Â¶ÇÊûúÊâÄÊúâÁõ∏ÂÖ≥ÁöÑÁ™óÂè£ÈÉΩÊ≤°Êúâdata-night-modeÂ±ûÊÄßÔºåÂàôËøîÂõûfalse
  }


  function isDarkMode() {
    const bodyElement = document.body;
    const linkElement = document.querySelector('a');
    if (!bodyElement || !linkElement) {
      return false; // Return false or any default value
    }
    const bgColor = window.getComputedStyle(bodyElement).backgroundColor;
    const textColor = window.getComputedStyle(bodyElement).color;
    const linkColor = window.getComputedStyle(linkElement).color;

    function calculateBrightness(color) {
      let colors = color.match(/\d+/g);
      colors = colors.map(c => parseInt(c, 10));
      const brightness = Math.round(((colors[0] * 299) + (colors[1] * 587) + (colors[2] * 114)) / 1000);
      return brightness;
    }

    const bgBrightness = calculateBrightness(bgColor);
    const textBrightness = calculateBrightness(textColor);
    const linkBrightness = calculateBrightness(linkColor);

    return bgBrightness < 128 && (textBrightness > 128 && linkBrightness > 128);
  }

