  function getUniqueSelector(element) {//Ëé∑ÂèñÂÖÉÁ¥†ÁöÑÂîØ‰∏ÄÈÄâÊã©Âô®
    if (element.id) {
      return '#' + element.id;
    }
    if (element.className && typeof element.className === 'string') {
      return '.' + element.className.split(' ').join('.');
    }
    return element.tagName.toLowerCase();
  }

